# Definition for singly-linked list.
class ListNode:
    @classmethod
    def builder(cls, l):
        # if len(l) == 1:
        #     return ListNode(l[0])
        # else:
        #     val = l.pop(0)
        #     return ListNode(val=val, next=ListNode.builder(l))
        if len(l) < 1:
            return
        prev = None
        for e in l:
            node = ListNode(val=e, next=prev)
            prev = node
        return node

    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next
    
    def print(self):
        print(self.val, end="")
        if self.next:
            print('->', end="")
            self.next.print()
        else:
            print()


class Solution:
    def __popList(self, head=ListNode) -> ListNode:
        node = head
        prev = head
        while True:            
            if node.next == None:
                prev.next = None
                return node
            prev = node
            node = node.next

    def isPalindrome(self, head: ListNode) -> bool:
        if head is None:
            return True
        node = head
        while True:
            tail = self.__popList(node)
            if node.val != tail.val:
                return False
            if node is tail:
                return True
            if node.next is None:
                return True
            node = node.next


